import React from "react";

import { BrowserRouter as Redirect, Route } from "react-router-dom";

const PrivateRoute = function({...rest}){
    return <Route
        {...rest}
        render={props => 
            localStorage.getItem("authToken") ? (
                <Component {...props}/>
            ) : (
                rest.handleRedirect("/login")
            )
        }
    />
}

export default PrivateRoute;
